actionConfiguration.body:
(tabName, feedback) => {
  rating.mergeObj = {
    ...appsmith.store.feedback,
    ...feedback
  };
  storeValue('feedback', rating.mergeObj);
  storeValue('layoutTab', tabName);
  addFeedback.run(appsmith.store.feedback);
}

